import React from "react";
import "./App.css";
import AboutMe from "./AboutMe/AboutMe";
import Portfolio from "./Portfolio/Portfolio";
import ContactForm from "./ContactForm/ContactForm";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <AboutMe />
        <Portfolio />
        <ContactForm />
      </header>
    </div>
  );
}

export default App;

